import React from 'react'
import { Link } from 'react-router-dom';

const App = () => {
  return (
    <>
      <nav 
        style={{
          borderBottom: 'solid 1px',
          paddingBottom: '1rem',
        }}
      >
        <Link to='/invoices'>Invoices</Link> | {" "}
      </nav>
      <h1>Alaa's Site</h1>
    </>
  )
}

export default App
